import React from "react";
import "./Navbar.css";
import { NavLink } from "react-router-dom";

// svg files
import HomeIcon from "../assets/home.svg";
import WorkoutIcon from "../assets/findworkout.svg";
import MeetIcon from "../assets/meetothers.svg";
import ProfileIcon from "../assets/profile.svg";

const Navbar: React.FC = () => {
  return (
    <nav className="bottom-navbar">
      <ul>
        <li>
          <NavLink
            to="/"
            className={({ isActive }) => (isActive ? "active" : "")}
          >
            <img
              src={isActive ? HomeIconActive : HomeIcon}
              alt="Home"
              className="icon"
            />
            <span className="label">Home</span>
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/find-workout"
            className={({ isActive }) => (isActive ? "active" : "")}
          >
            <img src={WorkoutIcon} alt="Find A Workout" className="icon" />
            <span className="label">Find A Workout</span>
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/meet-others"
            className={({ isActive }) => (isActive ? "active" : "")}
          >
            <img src={MeetIcon} alt="Meet Others" className="icon" />
            <span className="label">Meet Others</span>
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/profile"
            className={({ isActive }) => (isActive ? "active" : "")}
          >
            <img src={ProfileIcon} alt="Profile" className="icon" />
            <span className="label">Profile</span>
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
